import {useEffect, useState} from 'react';
import './ListStaff.css';
function ListStaff() {
    const [staffs, setStaffs] = useState([]);
    var staffsAPI = 'http://localhost:5000/staff/get_all'
    useEffect(() => {
        const getStaffs = async () => {
            const res = await (await fetch(staffsAPI)).json();
            setStaffs(res);
        };
        getStaffs();
    }, []);
    console.log(staffs);
    return (
        <div className='staffs'>
            <table id="customers" className='staff_table'>
                <tr className='staff-tr'>
                    <th className='head_list'>ID</th>
                    <th className='head_list'>Tên</th>
                    <th className='head_list'>SĐT</th>
                    <th className='head_list'>Email</th>
                    <th className='head_list'>Địa chỉ</th>
                    <th className='head_list'>Hành động</th>
                </tr>
                {staffs.map(staff => (
                    <tr className='staff_tr'>
                        <th>{staff.id}</th>
                        <th>{staff.name}</th>
                        <th>{staff.phone}</th>
                        <th>{staff.email}</th>
                        <th>{staff.address}</th>
                        <th>Sửa Xóa</th>
                    </tr>
                ))}
                {/* <tr>
                    <td>Alfreds Futterkiste</td>
                    <td>Maria Anders</td>
                    <td>Germany</td>
                </tr> */}
            </table>
        </div>
    )
}
export default ListStaff;
